  false,\n\t\"url\": null,\n\t\"notes\": \"As one of 14 priority urban wildlife refuges
  and a flagship urban refuge in Region 1, Tualatin River NWR is well-positioned to
  leverage a large group of volunteers and partners for invasive species prevention,
  control, and monitoring efforts. With over 200 volunteers and 130,000 visitors annually,
  the refuge can have an exponential impact in fostering conservation through combating
